// src/components/Navbar.js
import React from 'react';
import styled from 'styled-components';

const NavbarContainer = styled.div`
  background-color: r;
  padding: 10px 20px;
  display: flex;
  justify-content: space-between;
  align-items: center;
  border-bottom: 1px solid #ddd;
`;

const Logo = styled.div`
  font-size: 24px;
  font-weight: bold;
  color: #ff5a5f;
`;

const NavLinks = styled.div`
  display: flex;
  gap: 15px;
`;

const NavLink = styled.div`
  text-decoration: none;
  color: #343a40;
  font-weight: 500;
  padding: 10px;
  cursor: pointer;
  &:hover {
    color: #ff5a5f;
  }
`;

const Dropdown = styled.div`
  position: relative;
  display: inline-block;
`;

const DropdownContent = styled.div`
  display: none;
  position: absolute;
  background-color: #f9f9f9;
  min-width: 160px;
  box-shadow: 0px 8px 16px 0px rgba(0,0,0,0.2);
  z-index: 1;
  
  ${Dropdown}:hover & {
    display: block;
  }
`;

const DropdownLink = styled.div`
  color: black;
  padding: 12px 16px;
  text-decoration: none;
  display: block;
  cursor: pointer;

  &:hover {
    background-color: #f1f1f1;
  }
`;

const Navbar = () => {
  return (
    <NavbarContainer>
      <Logo>MagicBricks</Logo>
      <NavLinks>
        <NavLink>Buy</NavLink>
        <NavLink>Rent</NavLink>
        <NavLink>Sell</NavLink>
        <Dropdown>
          <NavLink>Agents</NavLink>
          <DropdownContent>
            <DropdownLink>Agent 1</DropdownLink>
            <DropdownLink>Agent 2</DropdownLink>
            <DropdownLink>Agent 3</DropdownLink>
          </DropdownContent>
        </Dropdown>
        <Dropdown>
          <NavLink>Projects</NavLink>
          <DropdownContent>
            <DropdownLink>Project 1</DropdownLink>
            <DropdownLink>Project 2</DropdownLink>
            <DropdownLink>Project 3</DropdownLink>
          </DropdownContent>
        </Dropdown>
        <NavLink>Contact</NavLink>
      </NavLinks>
    </NavbarContainer>
  );
};

export default Navbar;
